import React from "react";
import { useGlobalContext } from "./context";
import "./styles/"

function Home() {
  const { data } = useGlobalContext();

  console.log(data);
  return data.map((el) => {
    const { id, paymentDue, clientName, total, status } = el;
    return (
      <div className="info__component flex-vertical">
        <ul>
          <li>{id}</li>
          <li>{paymentDue}</li>
          <li>{clientName}</li>
          <li>{total}</li>
          <li>{status}</li>
        </ul>
      </div>
    );
  });
}

export default Home;
